def parse_args():
    '''
    Usual pythonic way of parsing command line arguments
    :return: all command line arguments read
    '''
    args = argparse.ArgumentParser("GODIT")

    args.add_argument('-d', "--sketch_size", default=256, type=int, help="Sketch Vector Size")

    args.add_argument('-k', "--disc_shingle", default=32, type=int, help="# of Discriminative Shingle")
    args.add_argument('-p', "--prob", default=0.2, type=int, help="Random Probability")
    args.add_argument('--directed', dest='directed',action='store_true',
                        help='Graph is (un)directed. Default is undirected.')
    args.add_argument('--undirected', dest='undirected', action='store_false')

    args.add_argument('-l', '--walk_len', default=50, type=int, help='Length of random walk ')

    args.add_argument('-n', '--n_shingle', default=3, type=int, help='Length of a shingle')

    args.add_argument('-f', '--filename', default='vast', help='Dataset filename')

    return args.parse_args()

def graph_sketching(args):
    with open('graphs/graphs_' + args.filename + '.json') as jsonfile: # graphs_nyctaxi_3month  graphs_vast_total_30sec  graphs_muta iot_1weekOct  graphs_darpa_10min  iot_june_01  sample_weight_3
        graphs = json.load(jsonfile)
    print("[ ", len(graphs), " ] graphs read successfully")

    sketch = Sketch()
    sketch_file =sketch.shingle_sketch(graphs, args)
    print("\n Done Batch Sketching...")
    return sketch_file

